import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import axios from 'axios';
import {
  ResponsiveContainer, PieChart, Pie, Cell, Tooltip, Legend,
  BarChart, Bar, XAxis, YAxis
} from 'recharts';
import '../styles/therapistRoutines.css';

export default function PatientInterests() {
  const { patientId } = useParams();
  const [planetMap, setPlanetMap] = useState(null);
  const [metrics, setMetrics] = useState(null);

  useEffect(() => {
    const fetchPlanet = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get(`/api/planet-map?patientId=${patientId}`, {
          headers: { 'x-auth-token': token }
        });
        setPlanetMap(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchPlanet();
  }, [patientId]);

  useEffect(() => {
    if (!planetMap || !planetMap.elements) return;
    const elements = planetMap.elements;
    const total = elements.length;
    const typesCount = {};
    const sizeDist = { '1': 0, '2': 0, '3': 0 };
    elements.forEach(el => {
      typesCount[el.elementId] = (typesCount[el.elementId] || 0) + 1;
      sizeDist[el.size] = (sizeDist[el.size] || 0) + 1;
    });
    const typeData = Object.entries(typesCount).map(([key, cnt]) => ({ name: key, value: cnt }));
    const avgSize = Object.entries(typesCount).map(([key, cnt]) => {
      const items = elements.filter(el => el.elementId === key);
      const avg = items.reduce((sum,i) => sum + i.size, 0) / cnt;
      return { name: key, avg: +avg.toFixed(2) };
    });
    const sizeData = Object.entries(sizeDist).map(([size, cnt]) => ({ size, count: cnt }));
    setMetrics({ total, uniqueTypes: Object.keys(typesCount).length, typeData, avgSize, sizeData });
  }, [planetMap]);

  if (!planetMap) {
    return (
      <div className="routines-container">
        <header className="routines-header">
          <Link to="/therapist/interests">← Volver</Link>
          <h2>Intereses del Paciente</h2>
        </header>
        <p>Cargando datos…</p>
      </div>
    );
  }
  if (!metrics) return null;

  const COLORS = ['#8884d8','#82ca9d','#ffc658','#ff8042','#0088FE'];

  return (
    <div className="routines-container">
      <header className="routines-header">
        <Link to="/therapist/interests">← Volver</Link>
        <h2>Intereses del Paciente</h2>
      </header>
      <div className="metrics-grid">
        <div className="metric-card">Total de Elementos: <strong>{metrics.total}</strong></div>
        <div className="metric-card">Tipos Únicos: <strong>{metrics.uniqueTypes}</strong></div>
      </div>
      <div className="charts-grid">
        <div className="chart-block">
          <h3>Distribución por Tipo</h3>
          <ResponsiveContainer width="100%" height={250}>
            <PieChart>
              <Pie data={metrics.typeData} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={80} label>
                {metrics.typeData.map((_, i) => <Cell key={i} fill={COLORS[i % COLORS.length]} />)}
              </Pie>
              <Tooltip /><Legend verticalAlign="bottom"/>
            </PieChart>
          </ResponsiveContainer>
        </div>
        <div className="chart-block">
          <h3>Tamaño Promedio por Tipo</h3>
          <ResponsiveContainer width="100%" height={250}>
            <BarChart data={metrics.avgSize} margin={{ top:20, right:30, left:0, bottom:0 }}>
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="avg" fill="#82ca9d" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        <div className="chart-block full-width">
          <h3>Distribución por Tamaño</h3>
          <ResponsiveContainer width="100%" height={250}>
            <PieChart>
              <Pie data={metrics.sizeData} dataKey="count" nameKey="size" cx="50%" cy="50%" outerRadius={80} label>
                {metrics.sizeData.map((_, i) => <Cell key={i} fill={COLORS[i % COLORS.length]} />)}
              </Pie>
              <Tooltip />
            </PieChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}
